import React from 'react';
import { Link } from 'react-router-dom';

const User = () => {
  return (
    <div className='userTable'>
        <Link to={"/add"}>Add User</Link>
        <table></table>
            <thead>
                <tr>
                    <th>S.No.</th>
                    <th>User Name</th>
                    <th>User Email</th>
                    <th>Action</th>
                </tr>
            </thead>
    </div>
  )
}

export default User
